import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

export default function Menu() {
  return (
    <div>
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
}
